import { useState } from "react";

export default function SearchPage() {
  const [query, setQuery] = useState("");

  const handleSearch = () => {
    console.log("검색 실행:", query);
    // TODO: API 호출 → 검색 결과 가져오기
  };

  return (
    <div className="min-h-screen bg-gray-50 flex flex-col items-center p-6">
      {/* 검색 박스 */}
      <div className="w-full max-w-3xl mb-8">
        <div className="flex items-center bg-white rounded-full shadow-md px-4 py-2">
          <input
            type="text"
            placeholder="검색어를 입력하세요..."
            value={query}
            onChange={(e) => setQuery(e.target.value)}
            className="flex-grow px-4 py-2 bg-transparent focus:outline-none text-gray-700"
          />
          <button
            onClick={handleSearch}
            className="ml-2 bg-blue-500 hover:bg-blue-600 text-white px-6 py-2 rounded-full transition"
          >
            검색
          </button>
        </div>
      </div>

      {/* 결과 영역 */}
      <div className="w-full max-w-6xl grid grid-cols-1 md:grid-cols-2 gap-6">
        {/* 텍스트 검색 결과 */}
        <div className="bg-white shadow-md rounded-2xl p-6">
          <h2 className="text-lg font-semibold mb-4 text-gray-800">텍스트 검색 결과</h2>
          <ul className="space-y-3">
            <li className="p-3 bg-gray-100 rounded-xl">검색 결과 1</li>
            <li className="p-3 bg-gray-100 rounded-xl">검색 결과 2</li>
            <li className="p-3 bg-gray-100 rounded-xl">검색 결과 3</li>
          </ul>
        </div>

        {/* 이미지 검색 결과 */}
        <div className="bg-white shadow-md rounded-2xl p-6">
          <h2 className="text-lg font-semibold mb-4 text-gray-800">이미지 검색 결과</h2>
          <div className="grid grid-cols-2 gap-4">
            <div className="h-32 bg-gray-200 rounded-xl flex items-center justify-center text-gray-400">
              IMG 1
            </div>
            <div className="h-32 bg-gray-200 rounded-xl flex items-center justify-center text-gray-400">
              IMG 2
            </div>
            <div className="h-32 bg-gray-200 rounded-xl flex items-center justify-center text-gray-400">
              IMG 3
            </div>
            <div className="h-32 bg-gray-200 rounded-xl flex items-center justify-center text-gray-400">
              IMG 4
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
